#include <string.h>
#include <stdio.h>
#include "cnn.h"

float relu(float x){
    return x > 0 ? x : 0;
}
int current_index = 0;
void run_cnn_layer(
        float_num_t cnn_input_buffer[KERNEL_SIZE][DATA_DEPTH],
        float_num_t cnn_weights[FILTER_SIZE][KERNEL_SIZE][DATA_DEPTH],
        float_num_t cnn_biases[FILTER_SIZE],
        float_num_t cnn_output_buffer[CNN_OUTPUT_LENGTH][CNN_DEPTH],
        float_num_t global_average[CNN_DEPTH]
){

    CNN_FILTER: for (int depth = 0; depth < FILTER_SIZE; depth++) {
    	float_num_t cnn_filter = 0;
    	CNN_KERNEL: for (int l = 0; l < KERNEL_SIZE; l++) {
#pragma HLS PIPELINE II=3
    		float_num_t cnn_value = 0;
    		CNN_DATA: for (int d = 0; d < DATA_DEPTH; d++) {
    			cnn_value += cnn_input_buffer[l][d] * cnn_weights[depth][l][d];
			}
    		cnn_filter += cnn_value;
		}
    	cnn_output_buffer[current_index][depth] = relu(cnn_filter + cnn_biases[depth]);
		if (current_index == CNN_OUTPUT_LENGTH - 1) {
			current_index = 0;
		} else {
			current_index++;
		}
	}
    for (int d = 0; d < CNN_DEPTH; d++) {
        float_num_t sum = 0;
        for (int i = 0; i < CNN_OUTPUT_LENGTH; i++) {
            sum += cnn_output_buffer[i][d];
        }
        global_average[d] = sum / CNN_OUTPUT_LENGTH;
    }
}

void run_dense_layer(
        float_num_t input_buffer[CNN_DEPTH],
        float_num_t dense_weights[DENSE_OUTPUT][DENSE_INPUT],
        float_num_t dense_bias[DENSE_OUTPUT],
        float_num_t dense_output[DENSE_OUTPUT]
){

    DENSE_OUTPUT_LAYER: for (int i = 0; i < DENSE_OUTPUT; i++) {
    // for each output, calculate confidence
    float_num_t output = 0;

    DENSE_INPUT_LAYER: for (int j = 0; j < DENSE_INPUT; j++) {
    output += input_buffer[j] * dense_weights[i][j];
}

    dense_output[i] = output + dense_bias[i];
}
}

